class Solution:
    def minDominoRotations(self, tops: list[int], bottoms: list[int]) -> int:
        size = len(tops)
        minSet = [0, size]
        if size == 0:
            return -1
        global flag
        flag = True

        for i in range(0,size):
            flag = True
            temp = 0
            for j in range(0,size):
                if i == j:
                    continue
                else:
                    if tops[j] == tops[i]:
                        continue
                    elif tops[j] != tops[i] and tops[i] != bottoms[j]:
                        flag = False
                        break
                    else:
                        temp += 1
            if flag:
                minSet[1] = min(minSet[1] , temp)
                if minSet[1] == temp:
                    minSet[0] = tops[i]
        for i in range(0,size):
            flag = True
            temp = 0
            for j in range(0,size):
                if i == j:
                    continue
                else:
                    if bottoms[j] == bottoms[i]:
                        continue
                    elif bottoms[j] != bottoms[i] and bottoms[i] != tops[j]:
                        flag = False
                        break
                    else:
                        temp += 1
            if flag:
                minSet[1] = min(minSet[1],temp)
                if minSet[1] == temp:
                    minSet[0] = tops[i]

        print(minSet[1])


